import { useEffect } from "react";

export const Meeting = () => {

  const runFunc = async () => {
      const cal = await getCalApi();
      cal("ui", {"styles":{"branding":{"brandColor":"#000000"}},"hideEventTypeDetails":false});
    }

  useEffect(() => {
    runFunc()
  }, [])

  return (
  <div>
  </div>
  )
};
